import React, { Component } from 'react';
import { Fragment } from 'react';

class CoursList extends Component {
	render() {
		return (
			<div>
				<Fragment>
			<li><span>
               {this.props.name}</span>
			   <button onClick={this.props.delet(this.props.index)}>Delet</button>
                </li>	</Fragment>
			</div>
		);
	}
}
export default CoursList;
